import { useState, useEffect } from "react";

const ContactList = () => {
    return(
        <div className="contactList">
            useEffect(() = {
                fetch("http://localhost:3030/contacts")
                .then(res => {
                    return res.json()
                })

            },[])
        </div>
    )
}
export default ContactList
